    "mobile-acoustical-bat-monitoring-summary-report-2012-dahomey-national-wildlife-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "This report summarizes bat calls collected
    along transects at Dahomey NWR in 2012. Calls were classified using EchoClass(v1.1)
    software, but classification of calls to species is not reported at this time due
    to ongoing software assessment and validation. Calls were geo-referenced and spatially
    projected for each survey period to identify relative bat use along transects. We
    will provide a revised annual summary report, transect shapefiles, and spatially
    referenced data output files once robust classifications to species are available.
    For surveys in which GPS data were not collected, a summary of the calls is presented
    without spatial reference.",nt"license_title": "License Not Specified",nt"extras":
